export interface IUser {
  email: string;
  name: string;
  isAdmin: boolean;
}

export interface IRegisterData extends Omit<IUser, "isAdmin"> {
  password: string;
}

export interface ICategory {
  name: string;
}

export interface IProduct {
  name: string;
  price: number;
  amount: number;
  description: string;
  image: string;
  category: ICategory;
}
